import './App.css';
import Heading from './Heading';
import React from 'react';
import Para from './Para';
import Pic from  './Pic';
import Mul from  './Mul';
import Div from './Div';

function App() {
  return (
    <>
      <Heading />

      <Para />
      <Mul />
      <Div />
      <Pic />
    </>
  );
}

export default App;
